const div = document.querySelector(".container")
const cart = document.querySelector(".add-to-cart")
phones.map(function (iteration, index) {
  return div.innerHTML += `
     <div class="card">
      <div class="img"><img src="${iteration.image}" alt="${iteration.brand}${iteration.model}" class="image"></div>
            <h1>Model : ${iteration.brand} ${iteration.model}</h1>
            <h1>Price : $${iteration.price}</h1>
            <h1>Camera : ${iteration.camera}</h1>
            <h1>Ram : ${iteration.ram}</h1>
            <h1>Rom : ${iteration.rom}</h1>
            <button class="Cart" onclick="addToCart(${index})">Add To Cart</button>
        </div>
    `
})


let CartArr;
const getData = JSON.parse(localStorage.getItem("cart"))
if (getData === null) {
  CartArr = [];
} else {
  CartArr = [...getData]
}


function addToCart(index) {
  const pushItems = CartArr.indexOf(phones[index]);
  if (pushItems === -1) {
    phones[index].quantity = 1;
    CartArr.push(phones[index]);
  } else {
    CartArr[pushItems].quantity += 1;
  }
  console.log(CartArr);
  Swal.fire({
    title: "Are you sure want to confirm your Order?",
    showDenyButton: true,
    showCancelButton: true,
    confirmButtonText: "Save",
    denyButtonText: `Don't save`
  }).then((result) => {
    if (result.isConfirmed) {
      Swal.fire("Order confirmed!", "", "success");
    } else if (result.isDenied) {
      Swal.fire("Changes are not saved", "", "info");
    }
  });

}
function GoTocart() {
  var cnvrtString = JSON.stringify(CartArr);
  localStorage.setItem("cart", cnvrtString)
  window.location = "cart.html";

}











